import React from 'react';
import { Link } from 'react-router-dom';
import { Container, Typography, Button } from '@mui/material';

function HomePage() {
  return (
    <Container
      maxWidth="xl"
      sx={{
        display: 'flex',
        flexDirection: 'column',
        justifyContent: 'center',
        alignItems: 'center',
        height: '100vh',
      }}
    >
      <div
        style={{
          backgroundImage: 'url("/path/to/hero-image.jpg")',
          backgroundSize: 'cover',
          backgroundPosition: 'center',
          width: '100%',
          height: '60vh',
          display: 'flex',
          flexDirection: 'column',
          justifyContent: 'center',
          alignItems: 'center',
          marginBottom: '2rem',
        }}
      >
        <Typography
          variant="h2"
          component="h1"
          align="center"
          sx={{
            color: 'white',
            textShadow: '2px 2px 4px rgba(0, 0, 0, 0.5)',
            marginBottom: '1rem',
          }}
        >
          QuantReady
        </Typography>
        <Button
          variant="contained"
          size="large"
          sx={{ backgroundColor: '#1976D2', color: 'white' }}
          component={Link}
          to="/login"
        >
          Get Started
        </Button>
      </div>
      {/* Rest of the content */}
    </Container>
  );
}

export default HomePage;
